    public static List<Boolean> solute(int[] a){
        List<Boolean> list = new ArrayList<>(a.length);
        int num=0;
        for (int i=0; i<a.length; i++){
            num = num << 1;
            num = a[i] == 0 ? num%5 : (num+1)%5 ;
            list.add(num == 0 ? true : false);
        }
        return list;
    }


